import React, { Fragment } from "react";
import { Button } from "@material-ui/core";

import Parallax from "../../components/parallax/parallax.component";

import { ArrowDropDownCircleTwoTone } from "@material-ui/icons";

//Material UI
import Grid from "@material-ui/core/Grid";

import Directory from "../../components/directory/directory.component";

const HomePage = () => {
  const image =
    "https://thumbor.thedailymeal.com/l89JXqysFyBCS2k0KPcrqH52OP8=/870x565/https://www.theactivetimes.com/sites/default/files/uploads/r/rsz_front_shutterstock_364445939.jpg";
  return (
    <Fragment>
      <Parallax filter image={image}>
        <Grid container justify="center">
          <a href="#lol" style={{ zIndex: "11" }}>
            <Button
              variant="contained"
              color="Secondary"
              startIcon={<ArrowDropDownCircleTwoTone />}
              endIcon={<ArrowDropDownCircleTwoTone />}
            >
              Visit Our Store Now
            </Button>
          </a>
        </Grid>
      </Parallax>

      <Directory />
    </Fragment>
  );
};

export default HomePage;
